import React from "react";

function TotalCard(props) {
  let numbers = props.totals;
  const AddedTotals = (...numbers) => {
    let res = numbers.reduce((num1, num2) => num1 + num2);
    return res;
  };
  return (
    <div>
      <p>{numbers}</p>
      {AddedTotals(numbers)}
    </div>
  );
}

export default TotalCard;
